import { withRouter } from 'next/router'
import '../styles.scss';

class Index extends React.Component {
    render() {
      const { router } = this.props
      return <h1 className="example" style={{color: 'red'}}>{router.pathname} hallo</h1>
    }
  }
  

  export default withRouter(Index)
